import React, { Fragment, useState } from "react";
import "../css/header.css";
import logo from "../brainster_space_logo.svg";

const Header = () => {
  const [spaceBlog, setSpaceBlog] = useState(false);
  const [nastani, setNastani] = useState(false);
  const [working, setWorking] = useState(false);
  const [akademii, setAkademii] = useState(true);
  const [prostor, setProstor] = useState(false);
  const [partnerstva, setPartnerstva] = useState(false);
  const yelow = () => {
    setSpaceBlog(true);
      setNastani(false);
      setWorking(false);
      setAkademii(false);
      setProstor(false);
      setPartnerstva(false);
  }
  const yelow1 = () => setNastani(true);
  const yelow0 = () => setWorking(true);
  const yelow2 = () => setAkademii(false);
  const yelow3 = () => setProstor(true);
  const yelow4 = () => setPartnerstva(true);
  return (
    <Fragment>
      <div className="header">
        <div className="logo">
          <img src={logo}></img>
        </div>
        <div>
          <ul>
            <li onClick={yelow} className={spaceBlog ? "yelowUnderline" : null}>
              SPACE БЛОГ
            </li>
            <li onClick={yelow1} className={nastani ? "yelowUnderline" : null}>
              НАСТАНИ
            </li>
            <li onClick={yelow0} className={working ? "yelowUnderline" : null}>
              CO-WORKING
            </li>
            <li onClick={yelow2} className={akademii ? "yelowUnderline" : null}>
              АКАДЕМИИ
            </li>
            <li onClick={yelow3} className={prostor ? "yelowUnderline" : null}>
              ПРОСТОР ЗА НАСТАНИ
            </li>
            <li
              onClick={yelow4}
              className={partnerstva ? "yelowUnderline" : null}
            >
              ПАРТНЕРСТВА
            </li>
          </ul>
        </div>
        <div className="prikluci">
          <ul>
            <li>
              <span>
                <i class="fa fa-plus" aria-hidden="true"></i>
              </span>
              ПРИКЛУЧИ СЕ
            </li>
          </ul>
        </div>
      </div>
      <div className={spaceBlog ? "showCategorii" : "hideCategorii"}>
        <ul>
          <li>ФЛИЛТРИРАЈ</li>
          <li>СИТЕ</li>
          <li>КАРИЕРА</li>
          <li>ТЕХНОЛОГИЈА</li>
          <li>DATA SCIENCE</li>
          <li>МАРКЕТИНГ</li>
          <li>ДИЗАЈН</li>
          <li>IMPACT</li>
          <li>#SpaceFamily</li>
        </ul>
      </div>
    </Fragment>
  );
};

export default Header;
